import "./style.css";

const About = () => {
  return (
    <div className="works">
      <h1>Experiences</h1>
      <p>Company: Paytm Payments Bank</p>
      <p>Role: SDE Intern</p>
      <p>Date: Nov 2020 - on going</p>
      <p>
Designed storybook of all the components
Changed the styling and layout of the whole paytm bank app single-handedly
Found and fixed critical bugs ensuring product met product requirements
Implemented various checks as assigned by the manager
Developed an algorithm with mentor to trigger various events like wishing 
user birthday,festivals etc 
Successfully completed all the tasks assigned by the team before the given
deadline
Worked in fast paced Agile environment on scrum team
 
      </p>
      <br />
    </div>
  );
};

export default About;
